import Axios from 'axios';
export default class HistoryRequester {

    async postHistory(history, precinctId) {
        try {
            const res = await Axios.post(`/history/${precinctId}`, history );
            return res;
        }
        catch(error) {
            console.log(error);
            return false;
        }
    }

    async postComment(comment, historyId) {
        console.log(comment);
        console.log(historyId);
        try {
            await Axios.post(`/history/comment/${historyId}`, comment );
            return true;
        }
        catch(error) {
            console.log(error);
            return false;
        }
    }
}
